import React, { Component } from 'react';

class LogIn extends Component {
  render() {
    return (
      <>
        <div>
          <h1> <i class="far fa-sticky-note"></i>StitchMate </h1>
          <p><button>Log In</button> <button>Register</button></p>
        </div>
      </>
    );
  }
}

export default LogIn;
